import React from "react";
import Robot from "../unit/Robot";

export default function RobotGrid() {
  const robot_data = [
    {
      name: "Jacinthe Herzog",
      image: "https://robohash.org/Jacinthe Herzog.png?size=120x120",
      price: "477.02",
      stock: 8,
      createdAt: "2020-08-29T15:34:43.424Z",
      material: "Wooden",
    },
    {
      name: "Lila Franecki",
      image: "https://robohash.org/Lila Franecki.png?size=120x120",
      price: "71.02",
      stock: 8,
      createdAt: "2020-08-28T19:46:28.571Z",
      material: "Plastic",
    },
    {
      name: "Rosalyn Gleason",
      image: "https://robohash.org/Rosalyn Gleason.png?size=120x120",
      price: "345.36",
      stock: 5,
      createdAt: "2020-04-19T06:31:07.464Z",
      material: "Steel",
    },
  ];

  // let cart = [];

  function addToCart(robot) {
    console.log("add cart event");
  }
  return (
    <div className="robot-wrapper">
      {robot_data.map((robot) => {
        return <Robot robot={robot} addToCart={addToCart()}></Robot>;
      })}
    </div>
  );
}
